      "path": "registry/aceternity/animated-tooltip.tsx",
      "content": "import { cn } from "@/lib/utils";
import { ReactNode } from "react";

interface AnimatedTooltipProps {
  className?: string;
  children?: ReactNode;
}

export default function AnimatedTooltip({
  className,
  children,
  ...props
}: AnimatedTooltipProps) {
  return (
    <div
      className={cn(
        "relative",
        className
      )}
      {...props}
    >
      {children}
    </div>
  );
}",
